import React from 'react';
import { Switch } from 'react-router-dom';
  

function Navbar(){
    return(
    
    <div>
        <Switch>
            <Link to="./About.js">About</Link>
        </Switch>

        <Switch>
            <Link to="./About.js">Feedback</Link>
        </Switch>
    </div>
    )
}
export default Navbar;
